import React from 'react';
import { CookiesProvider } from "react-cookie";
import './UserPanel.css';
import UserPanelHead from './UserPanelHead';
;

function UserPanel({ user }) {
    return (
        <CookiesProvider>
            <UserPanelHead user={user} />
        </CookiesProvider>
    );
}

export default UserPanel;
